import React, {Component} from 'react'

class Login extends Component {
  render() {
      return (
          <div>
            <header>
                Reni

            </header>
            <section>Fernanda</section>

            <footer>UPAO</footer>
            <style jsx>{`
                header {
                  padding: 0rem;
                  font-size: 10rem;
                  background-color: red;
                }
                div {
                  border: 2px solid;
                  padding: 20px; 
                  width: 300px;
                  resize: both;
                  overflow: auto;
               }

                section {
                  font-size: 5rem;
                  background-color: blue;
                }
              `}</style>


          </div>
      )
  }
}

export default Login
